const generarobserver = () => {
	const progress = document.querySelectorAll('.progress-bar');

	function callbackobserverhab(entries) {
		entries.forEach((entry) => {
			if (entry.isIntersecting) {
				entry.target.style.width =
					entry.target.attributes[2].nodeValue +
					'%';
			} else {
				entry.target.style.width = '1%';
			}
		});
	}

	const observerHab = new IntersectionObserver(callbackobserverhab, {});
	for (prog of progress) {
		observerHab.observe(prog);
	}
};

const htmlgenerator = (
	name,
	per,
	svg
) => `<div class="col col-6 col-md-4 col-lg-3 prog-box">
            <div class="d-flex justify-content-center">
                <h3 class="fs-4">${name}</h3>
            </div>
            ${svg}
            <div class="progress">
                <div class="progress-bar prog-red" role="progressbar" aria-valuenow="${per}" aria-valuemin="0"
                     aria-valuemax="100" style="width: 75%"></div>
            </div>
            <h3 style="text-align: center">${per}%</h3>
        </div>`;

const mostrarSkills = (tipo) => {
	let resulthtml = '';
	for (skill of jsonskillsdata[tipo]) {
		resulthtml += htmlgenerator(
			skill.name,
			skill.percent,
			skill.svg
		);
	}
	document.getElementById('skillsx').innerHTML = resulthtml;
	generarobserver();
};

mostrarSkills('lenguajes');
